import axiosInstance from './axiosInstance';

// Acepta { correo, contraseña } o { correo, contrasena } (sin ñ)
const LoginUser= async ({ correo, contraseña, contrasena }) => {
  try {
    const pass = contraseña ?? contrasena;
    return axiosInstance.post('/api/auth/login', { correo, contraseña: pass });
  } catch(error){
    return null;
  }
}

const RegistrarUser= async ({nombre,correo,contraseña,id_rol,telefono}) =>{
  try{
    return axiosInstance.post('/registrarse/',{nombre,correo,contraseña,id_rol,telefono});
  }catch(error){
     return null;
  }
}

export default {LoginUser,RegistrarUser}
